      edges:
        - node:
            text: "Gabi always picks the best presents\n\nBarbara, Lynn's sister came for a one week vacation to România, so we're doing a family trip around the country. We'll, half of the country this week.\n\nWhat impresses me every time, though, is my brother's talent of finding cool, personal presents for everybody. Like this fridge magnet.\n\nIn the middle of the tourist market, one half full with owl bags from China, the other full with romanian traditional wear, Gabi and Petruța found the one gem! A shop that hand painted part of the fridge magnet with your face and name \U0001F60D The perfect present: it's small, personal, and it's forever going to remind us of the day.\n\nAccording to the artist, the resemblance to Lynn is uncanny. \"Thank you brother for an awesome present!\" \"Of course it's awesome! I made it! \U0001F60E\" It's definitely gonna be a keeper!"
